import React from 'react';
import photo from "../../Assests/projects/run-buddy.jpg"

function Projects() {
    return (
        <section>
          <h1>Run-Buddy</h1>
          <p>Running App</p>
          <div className="flex-row">
              <img
                src={photo}
                alt="Commercial Example"
                className="img-thumbnail mx-1"
              />
          </div>
        </section>
      );
}
export default Projects;
